import { Container } from 'react-bootstrap';
import NavbarC from './component/NavbarC';
import Hider from './component/Hider'
import Category from './component/Category'
import './App.css';

function App() {
  return (
    <div className="w-100 font color-body">
      <NavbarC/>
      <Container>
        <Hider/>
        <Category/>
      </Container>
    </div>
  );
}

export default App;
